svg.script:
    // 
    function runNimWasm(w){for(i of WebAssembly.Module.exports(w)){n=i.name;if(n[0]==';'){new Function('m',n)(w);break}}}
    function myFunction() {
      const b64Data = document.getElementById("myImg").href.baseVal.split('base64,')[1];
      WebAssembly.compile(Uint8Array.from(atob(b64Data), c => c.charCodeAt(0))).then(runNimWasm);
    }

    document.querySelector("rect").addEventListener("click", (e) => {
      myFunction();
    });
    //
